import { List, Card } from 'antd';
import MyLayout from '../homeLayout/myLayout'

const MyList = (props) => {
    console.log(props);
    const data = props.shows.data.list;
    return (
        <MyLayout>
            <ul>
                {
                    props.shows.data.list.map((ele) => {
                        return (
                            <li>{ele.ironDir}</li>
                        )
                    })
                }
            </ul>
            <List
                grid={{
                    gutter: 16,
                    xs: 1,
                    sm: 2,
                    md: 4,
                    lg: 4,
                    xl: 6,
                    xxl: 3,
                }}
                dataSource={data}
                renderItem={() => (
                    <List.Item>
                        <Card title={item.ele.ironDir}>Card content</Card>
                    </List.Item>
                )}
            />
        </MyLayout>
    )
}

MyList.getInitialProps = async function () {
    const res = await fetch('https://worker-api.wanshifu.com/master/listinfo');
    const data = await res.json();
    return {
        shows: data
    }
}

export default MyList
